import Head from "next/head";
import Navbar from "../components/Navbar";


const About = () => (
    <div>
        <Navbar />
        <Head>
            <title>Gerilimsiz Todo Application</title>
            <meta name="viewport" content="initial-scale=1.0, width=device-width" />
            <link href="/static/App.css" rel="stylesheet" />
        </Head>
        <h1  className="header">Gerilimsiz TodoApp</h1>
        <p  className="" style={linkStyle}>Gerilimsiz is the stress reduction App that would help you schedule and manage your workflow by adding and deleting tasks todo, thereby reducing workload stress.</p>
      <h3 style={linkStyle}>About App</h3>
    </div> 
);

const linkStyle = {
    textDecoration: 'none',
    weight: 'bold',
    color: '#000',
}

const navStyle = {
    margin: '0',
    fontstyle: 'italic',  
    background: '#3367d6',
    textAlign: 'center',
    padding: '40px',
    color: '#fff'
}

export default About;
